import * as React from "react";
import Paper from "@mui/material/Paper";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import { Cols, Rows } from "./types";

const columns: Cols[] = [
  { id: "img", label: "ÏÇ¨ÏßÑ Ïù¥ÎØ∏ÏßÄ", minWidth: 100 },
  { id: "name", label: "ÏÉÅÌíàÎ™Ö", minWidth: 100 },
  { id: "price", label: "Í∞ÄÍ≤©", minWidth: 170 },
  { id: "button", label: "Íµ¨Îß§ÌïòÍ∏∞", minWidth: 170 },
];

const rows: Rows[] = [
  {
    img: `<i class="fa-solid fa-bowl-food"></i>`,
    name: "ÏÉÅÌíàA",
    price: 3000,
    button: "button",
  },
  { img: "‚öΩ", name: "ÏÉÅÌíàB", price: 10000, button: "button" },
  { img: "üß¢", name: "ÏÉÅÌíàC", price: 15000, button: "button" },
  { img: "üíº", name: "ÏÉÅÌíàD", price: 40000, button: "button" },
];

const InfoTable = () => {
  return (
    <Paper sx={{ width: "100%", overflow: "hidden" }}>
      <TableContainer sx={{ maxHeight: 440 }}>
        <Table stickyHeader aria-label="sticky table">
          <TableHead>
            <TableRow>
              {columns.map((column) => (
                <TableCell
                  key={column.id}
                  style={{ minWidth: column.minWidth }}
                >
                  {column.label}
                </TableCell>
              ))}
            </TableRow>
          </TableHead>
          <TableBody>
            {rows.map((row) => {
              return (
                <TableRow hover role="checkbox" tabIndex={-1}>
                  <i className="fa-solid fa-bowl-food fa-xl"></i>
                  <TableCell>{row["name"]}</TableCell>
                  <TableCell>{row["price"]}</TableCell>
                  <TableCell>{row["button"]}</TableCell>
                </TableRow>
              );
            })}
          </TableBody>
        </Table>
      </TableContainer>
    </Paper>
  );
};

export default InfoTable;
